import React from 'react'
import Footer from "../components/Footer"
import HeroSection from '../components/HeroSection';

function Universe() {
    return (
        <div className='universe'>
            <h1>Universe</h1>
            <HeroSection />
            <Footer/>
        </div>
    )
}

export default Universe
